    // adds a previously unknown NLC - if a cluster we will start 
    // at a different integer offset. Returns true if added or 
    // false if nlc already known:
    bool AddNLC(std::string nlc, bool cluster)
    {
        bool result;
        auto p = nlcmap_.find(nlc);
        if (p == nlcmap_.end())
        {
            result = true;
            int numericEquiv;
            if (cluster)
            {
                numericEquiv = newClusterCount + clusterCount++;
            }
            else
            {
                numericEquiv = newAlphaCount + alphaCount++;
            }
            nlcmap_[nlc] = numericEquiv;
        }
        else
        {
            result = false;
        }
        return result;
    }

    inline int GetIntegerNLC(std::string nlc)
    {
        int result;
        auto p = nlcmap_.find(nlc);
        if (p == nlcmap_.end())
        {
            result = 0;
        }
        else
        {
            result = p->second;
        }
        return result;
    }
